濡れた手でも使える防滴仕様の時計つきタイマーです。5種のリズムからアラーム音を選べ、カウントダウン・カウントアップ・リピート機能も付いています。マグネット・スタンド・ストラップ穴付きです。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">濡れた手でも使える防滴仕様の時計つきタイマーです。5種のリズムからアラーム音を選べ、カウントダウン・カウントアップ・リピート機能も付いています。マグネット・スタンド・ストラップ穴付きです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">W90mm×H82mm×D17mm</font><br><font color="#333333" size="-1">個装サイズ：11×18×2cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約84g</font><br><font color="#333333" size="-1">個装重量：106g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ABS</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">使用電池:単4形乾電池×1本(テスト電池付属)<br>電池寿命:約1年(※1日1回アラームを使用した場合)<br>最大設定時間:カウントダウン:99分59秒、カウントアップ:99分59秒<br>アラーム時間:約60秒<br>アラーム音量:約80dB<br>防滴仕様:IPX1<br>マグネット・スタンド・ストラップ穴付き</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書、保証書(保証期間:1年)、単4形乾電池(テスト用)、電池フタ用ミニドライバー</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
