　厚切りのお餅をじっくり丁寧に時間をかけて煎ることで、お米の風味あふれるあられに仕上げた岩塚製菓の「鬼ひび」。<br>外はカリッ、中はサクッとした食感が特長のあられです。<br>味付けには赤穂の焼塩を使用し、かめばかむほどもち米の風味が味わえます。<br>工場できたて直送感を出した箱商品。食べやすい5個入りの個包装が12袋入ってます。<br>個人・ご家族でのご愛好のほか、ちょっとした手土産や贈り物にも最適です。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>内容量：5個×12袋<br><br>購入単位：1箱(60個)<br>配送種別：在庫品</p></td></tr></table><br><br><font color=#ff0000>ご注文より２週間程度お時間頂く場合もございます。ご了承下さい。</font><br><br><br><img src=http://image.rakuten.co.jp/onestep/cabinet/parts/kochiramo.jpg><br><br><br>原材料：水稲もち米(日本)、植物油脂、食塩、調味料(アミノ酸等)<br>内容量：60個<br><br><br><font size=1 color=#000000>【検索用キーワード】<br>楽天 通販 【米菓】 米菓 食品飲料・産直グルメ お菓子 おかき いわつかのおにひび 60こ  sh0500 9C0483 厚切り お餅 じっくり 丁寧 時間 お米の風味 あられ アラレ 香ばしさ おせんべい せんべい おかき オカキ センベイ おいしい オヤツ おやつ お菓子 オカシ おかし 子供 こども セット 大容量　お菓子　よろずやマルシェ　お菓子　菓子　おかき　岩塚製菓　贈答品　贈り物　プレゼント 贈答おかき</font><br><style type="text/css">
